import {User} from "../types/User";

// Reducer for 책 endre siden vi er p책
const userReducer = (user = null, action: { type: string; payload: User; }) => {
    switch (action.type) {
        case 'login':
            return action.payload;
        case 'logout':
            return null;
        default:
            return user;
    }
}
export default userReducer;
